text:
@RobertoBurioni @borghi_claudio Giusto! 
Dovrebbe valere per tutti. Gli ignoranti (che ignorano), come me, sono liberi di porre domande e chi sa può rispondere, senza arroganza o pregiudizio.
Stessa cosa quando si cambia campo e si passa a Costituzione, leggi, libertà, filosofia morale, etc.

@la_ulisse @LucaBizzarri La puzza che sente però è quella del suo pregiudizio. 
Primo. Pongo ogni giorno dubbi, domande o faccio affermazioni non scontate o allineate. Su molti temi. Uso Twitter per questo. 
Poi. Propaganda per cosa, visto che mi sono autoescluso, per scelta, dalla politica?

@LucaBizzarri @borghi_claudio Io non sono all’opposizione! 
Io non sono più in Parlamento o politica da anni. 
Perché questo tentativo di “classificare” le mie parole in stereotipi facili?

@LucaBizzarri No, è una domanda vera, non un modo per instillare dubbi. Perché vorrei capire. Vorrei capire come funziona la “Diga” vaccino e quando sarà efficiente al massimo. 
Farsi domande secondo me serve sempre. Poi fa un po’ tu.
Cosa non serve è aizzare i cani di Twitter.

